import Section1 from "../components/HopePageSections/Section1";
import Section2 from "../components/HopePageSections/Section2";
import Section3 from "../components/HopePageSections/Section3";
import Section4 from "../components/HopePageSections/Section4";
// What non-users see
// - View all programs
// - View all coursese
// - Button to go to Signup
// - Button/link to Login (can be modal or separate page)

function Home() {
  return ( 
    <div className="mt-0">
      <Section1></Section1>
      <Section2></Section2>
      <Section3></Section3>
      <Section4></Section4>
    </div>
  );
}

export default Home;
